        private async Task CheckRolesAsync()
        {
            await _userHelper.CheckRoleAsync("Admin");
            await _userHelper.CheckRoleAsync("User");
            await _userHelper.CheckRoleAsync("Attention");
        }

        private async Task CheckUserType()
        {
            if (!_context.UserTypes.Any())
            {
                _context.UserTypes.Add(new UserType { Name = "Admin", });
                _context.UserTypes.Add(new UserType { Name = "User", });
                _context.UserTypes.Add(new UserType { Name = "Attention", });
                await _context.SaveChangesAsync();
            }                
        }
        private async Task<User> CheckUserAsync(string document, string firstName, string lastName, string motherLastName, string email, string phone, string address, string userType)
        {
            User user = await _userHelper.GetUserAsync(email);
            UserType _userType = _context.UserTypes.Where(u => u.Name == userType).FirstOrDefault();
            if (user == null)
            {
                user = new User
                {
                    FirstName = firstName,
                    LastName = lastName,
                    MotherLastName = motherLastName,
                    Email = email,
                    UserName = email,
                    PhoneNumber = phone,
                    Address = address,
                    Document = document,
                    UserType = _userType
                };

                await _userHelper.AddUserAsync(user, "123456Aa");
                await _userHelper.AddUserToRoleAsync(user, userType);
            }

            return user;
        }


